import './App.css';
import Application from './Components';
import "react-toastify/dist/ReactToastify.css"
import { AppContext } from '../src/Util/AppContext';
import refreshApi from "./Util/refreshApi";


function App() {
  return (
    <AppContext.Provider refresh={refreshApi}>
      <Application />
  </AppContext.Provider>
  );
}

export default App;
